import React from "react";
import SimpleCard from "./components/Cards";
import "./App.css";
import DropdownSelect from "./components/Dropdown";

function App() {
  return (
    <>
      <div className="container-header">
        <h1>Covid-19 Tracker</h1>
      </div>
      <div className="container-1">
        <div className="box-1">
          <SimpleCard name="TotalDeaths" text="Confirmed" />
        </div>
        <div className="box-2">
          <SimpleCard text="Recovered " />
        </div>
        <div className="box-2">
          <SimpleCard text="Deaths" />
        </div>
      </div>
      <div className="container-2">
        <DropdownSelect />
      </div>
    </>
  );
}

export default App;
